import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import Top from "./Top";
import About from "./About";
import Num1 from "./1";
import SchoolArchive from "./SchoolArchive";


class Layout extends React.Component {
    navigate() {
        console.log(this.props.history);
        this.props.history.push("/");
    }
    render() {
        return (
            <Router>

                    {/*A <Switch> looks through all its children <Route>lements and renders the first one whose pathmatches the current URL. Use a <Switch> any time you have multiple routes, but you want only one of them to render at a time */}
                    <div className="daily">
                        <Switch>
                            <Route exact path="/">
                                <Top />
                            </Route>
                            <Route path="/about">
                                <About />
                            </Route>
                            <Route path="/archive">
                                <SchoolArchive />
                            </Route>
                            <Route path="/1">
                                <Num1 num="1" />
                            </Route>
                        </Switch>
                    </div>

                <div className="dialy">
                    <ul>
                        <li>
                            <Link to="/">Top</Link>
                        </li>
                        <li>
                            <Link to="/about">About</Link>
                        </li>
                        <li>
                            <Link to="/archive">WebGL School Archive</Link>
                        </li>
                        <li>
                            <Link to="/1"><img src="./img/moon.svg" alt="day"/>1</Link>
                        </li>
                    </ul>

                </div>
            </Router>
        );
    }
}


export default Layout;
